import React from 'react';
import {TextField} from '@material-ui/core';

const Form = () => {
    return (
        <React.Fragment>
            <TextField id="outlined-textarea" label="Multiline Placeholder" placeholder="Placeholder" multiline
                className={
                    classes.textField
                }
                margin="normal"
                variant="outlined"/>
        </React.Fragment>
    );
}

export default Form;
